import React from "react";
import {
  Outlet,
  Route,
  Routes,
  useLocation,
  useParams,
} from "react-router-dom";
import { createBrowserHistory } from "history";
import { TransitionGroup, CSSTransition } from "react-transition-group";
import styled from "styled-components";

import { Welcome, Works } from "../pages/";

//Import pages
import {
  notFound,
  coc2016,
  yng,
  viaf,
  doh,
  gutsy,
  cardivu,
  heartfit,
} from "../pages";
import { GlobalStyle } from "../pages/sharedStyle";

// const history = createBrowserHistory();

const App = () => {
  const location = useLocation();
  return (
    <>
      <GlobalStyle />
      <Routes location={location} key={location.pathname + "_routes"}>
        <Route path="/" element={<Welcome />} />
        <Route path="/works/*" element={<Works />}>
          {/* <Route path=":contentsId" element={<ContentsLoader />} /> */}
        </Route>
      </Routes>
      {/* <AnimatePresence exitBeforeEnter>
      </AnimatePresence> */}
    </>
  );
};

function ContentsLoader() {
  let { contentsId } = useParams();
  console.log("ID: " + contentsId);
  var page = null;

  switch (contentsId) {
    case "coc2016":
      page = coc2016();
      break;

    case "yng":
      page = yng();
      break;

    case "viaf2021":
      page = viaf();
      break;

    case "gutsy":
      page = gutsy();
      break;

    case "heartfit":
      page = heartfit();
      break;

    case "doh":
      page = doh();
      break;

    case "cardivu":
      page = cardivu();
      break;

    // else:
    //   //return 404;
    //   return (
    //     <main style={{ padding: "1rem" }}>
    //       <p>There's nothing here!</p>
    //     </main>
    //   );
  }
  console.log(page);
  return (
    <>
      {page()}
      <Outlet />
    </>
  );
}

export default App;
